    <div class="card-big">
        <h3>My Work</h3>
        <hr>
        <h4>Web Developer</h4>
        <h5>View9 | Nepal</h5>
        <h5>Jan 2019 - Present</h5>
        <p>I develop the backend of website and connect its database to different platforms with api.</p><br>
        <h4>Juniour Android Developer</h4>
        <h5>Fixolla | India</h5>
        <h5>Feb 2018 - Dec 2018</h5>
        <p>I was not only the part of android development team but also developed api services for the website.</p><br>
        <h4>Security Analyst</h4>
        <h5>Fixolla | India</h5>
        <h5>Sep 2017 - Feb 2018</h5>
        <p>I helped the company in building their database and securing it from different threats.</p><br>
        <h4>Service and Sales Engineer</h4>
        <h5>A2Z Laundry Solutions | India</h5>
        <h5>Dec 2016 - Dec 2018</h5>
        <p>I was involved in laundry business setup, marketing and it growth for dorzens of laundries in India. I am one of the authorised service Engineer for Danube International (France), Pony(Italy) and SEKO (USA). Beside these, I am involved in other brands like Electrolux (Sweden), Maytag (USA), Speedqueen (USA), Hydrosystems (USA), SEITZ (Germany) and Sunrise (India).</p>
    </div>
    <div class="hasil-card">
        <h4>RFID Limitor</h4>
        <p>An Arduino UNO based project for limiting the RFID Scans.</p>
    </div>
    <div class="hasil-card">
        <h4>Pickup and Delivery App</h4>
        <p>Android app for fixolla.com for their pickup and delivery service.</p>
    </div>
    <div class="hasil-card">
        <h4>Electrical Thief Eliminator</h4>
        <p>This device detects, locates and terminates the electricity thief from the supply line.</p>
    </div>
    <div class="hasil-card">
        <h4>Achievements unlocker</h4>
        <p>PHP based script for unlocking achievements of any game based on Google api services. Additionally it is capable to push fake highscore to Google's leaderboard.</p>
    </div>
    <div class="hasil-card">
        <h4>RABC Analyser</h4>
        <p>Windows console based app for extracting the total washes done in Danube Washer. Also C# based GUI app is partially developed!</p>
    </div>
    <div class="hasil-card">
        <h4>Electrical Performance Analyser</h4>
        <p>An Arduino UNO based project for realtime data recording and analysis.</p>
